import '../styles/Home.css';

function Intro() {
    return (
        <div className="intro-container">

            <div className="intro-paragraph">

                <h3>  So, you want to travel to Space Let’s face it; if you want to go to space, you might as well genuinely go to outer space and not hover kind of on the edge of it. Well sit back, and relax because we’ll give you a truly out of this world experience!</h3>
            </div>

            <div className="intro-cirlce">
                <h1>Explore</h1>
            </div>
        </div>
    );
}

export default Intro;
